import Navigation from "../../Naviagtion/Navigation";
import PageContent from "./PageContent";
const ErrorPage = () => {
  return (
    <main>
      <Navigation />
      <PageContent>
        <h1>An error has occured!</h1>
        <p>Could not find this page</p>
      </PageContent>
    </main>
  );
};

export default ErrorPage;
